import { NavLink } from "react-router-dom";

const Botones = () => {

    const Estilos = {
        Main: 'flex justify-between',
        Previus: 'w-[10%] bg-[#1b6102] rounded-lg border-8 border-[#2da202] border-double my-1 font-[system-ui] font-semibold text-white sticky z-10',
        Div: 'flex justify-evenly content-end h-1/5 my-12',
        Button: "",
    }

    return (
        <main className={Estilos.Main}>
            <button className={Estilos.Previus}><img src="../Fondos/flecha.png" alt="" srcset="" /></button>
            <div className={Estilos.Div}>
                <button className='bg-[#1b6102] rounded-lg border-8 border-[#2da202] border-double my-1 font-[system-ui] font-semibold text-5xl text-white sticky z-10'>
                <NavLink to="List">List View</NavLink>
                </button>
                <button className={Estilos.Button}>
                    <NavLink to="/">Details</NavLink>
                </button>
                <button className={Estilos.Button}>
                <NavLink to="/">Search</NavLink>
                </button>
                <button className={Estilos.Button}>
                <NavLink to="/">Close</NavLink>
                </button>
            </div>
            <button className={Estilos.Cambio} >PREVIOUS</button>
        </main>
    );
}

export default Botones;
